import logging as logfrom file_handler import FileHandlerfrom csv_handler import CSVHandlerfrom data_calculator import DataCalculator as DataCalcdef main():    """    Main function to run the program, opens a file dialog to select the data file to process.    """    # Initialize the FileHandler    file_handler = FileHandler()    try:        # Retrieve the file path using the FileHandler class        file_path = file_handler.retrieve_file()    except Exception as e:        log.error(f"\n\tError: {e}\n")        return    # Initialize the CSVHandler    csv_handler = CSVHandler(file_path)    try:        # Read the data using the CSVHandler class        data = csv_handler.read_data()    except Exception as e:        log.error(f"\n\tError: {e}\n")        return    log.info("\n\tData read successfully\n")    log.debug(f"\n{data.head(5)}\n")    # Iterate through each column in the DataFrame and perform analysis    for col in data.columns:        analysis = DataCalc(data[col].tolist())        log.info(f"\n\tAnalysis for {col}")        log.info(f"\n\tMean: {analysis.mean}")        log.info(f"\n\tMedian: {analysis.median}")        log.info(f"\n\tMode: {analysis.mode}")        log.info(f"\n\tVariance: {analysis.variance}")        log.info(f"\n\tStandard deviation: {analysis.standard_deviation}")        log.info(f"\n\tMin: {analysis.min}")        log.info(f"\n\tMax: {analysis.max}\n")if __name__ == "__main__":    # Set the log level to debug    log.basicConfig(level=log.DEBUG)    main()